import React from "react"
import styles from "./Checkout.module.css"

export class Checkout extends React.Component{
  constructor(props){
    super(props)
    this.locationHook=props.myHookValue
    this.exchange = new URLSearchParams(locationHook.search).get          ('exchange');
    this.offer = new URLSearchParams(locationHook.search).get('offer'     );
    this.samsungCare = new URLSearchParams(locationHook.search).get      ('careplus');
    this.colors = new URLSearchParams(locationHook.search).get('color'    );
    this.configs = [];
  }

  render(){
    return(
    <React.Fragment>
    <div className={styles.container}>

    <img className={styles.deviceImg} src={new URLSearchParams(locationHook.search).get('image')}/>
    <div className={styles.deviceConfig}>
    <ul>
    </ul>
    </div>

    </div>
    </React.Fragment>
    )

  }
}
